async def assign_ratings_to_users(db, redis_client):
    attraction_service = AttractionService(db, redis_client)
    users = db.query(User).all()

    for user in users:
        user_preferences = db.query(UserPreference).filter(UserPreference.user_id == user.id).all()

        #Rate Highly attractions which fall under categories the user likes
        for preference in user_preferences:
            attractions_within_category_liked_by_user = tourist_attractions_by_category[preference.category_id]
            attractions_to_rate = random.sample(attractions_within_category_liked_by_user, 20)
            for idx, attraction_id in enumerate(attractions_to_rate):
                if idx < 10:
                    rating = 5
                elif 10 <= idx < 18:
                    rating = 4
                elif idx == 18:
                    rating = 3
                else:
                    rating = 2
                await attraction_service.rate_attraction(attraction_id, user.id, rating)

        #Give Low Ratings to categories user hadn't selected as liked categories
        category_ids = [pref.category_id for pref in user_preferences]
        available_category_keys = [key for key in tourist_attractions_by_category.keys() if key not in category_ids]
        sample_of_not_liked_categories = random.sample(available_category_keys, 3)
        for category_id in sample_of_not_liked_categories:
            attractions = tourist_attractions_by_category[category_id]
            sample_of_attractions = random.sample(attractions, 5)
            for idx, attraction_id in enumerate(sample_of_attractions):
                if idx < 3:
                    rating = 2
                else:
                    rating = 5
                await attraction_service.rate_attraction(attraction_id, user.id, rating)







